import './styles/base.scss'
import './styles/app.scss'

import logo from './assets/images/logo.png'

function App() {
    return (
        <div className="App">
            <header className='AppHeader'>
                <div className='HeaderLogo'>
                    <img src={logo} alt="Логотип" />
                </div>
            </header>
        </div>
    );
}

export default App;
